	double _InnerProduct(double *A, double *B, int arrayLength)
	{
		double InPr = 0;
		for (int i = 0; i < arrayLength; i++)
		{
			InPr = InPr + (A[i] * B[i]);
		}
		return InPr;
	}
	float _InnerProduct(float *A, float *B, int arrayLength)
	{
		float InPr = 0;
		for (int i = 0; i < arrayLength; i++)
		{
			InPr = InPr + (A[i] * B[i]);
		}
		return InPr;
	}
	TdArr _GetArrayR(int StartValue, int EndValue, int IncStep)
	{
		TdArr tr(this->MemManager);
		if (IncStep>0)
		{
			int size = (EndValue - StartValue + 1) / IncStep;
			int mod = (EndValue - StartValue + 1) % IncStep;
			if (mod > 0)
			{
				size++;
			}
			if (size < 1)
			{
				return tr;
			}
			double* res = this->AllocDouble(size);
			int index = 0;
			for (int i = StartValue; i <= EndValue; i += IncStep)
			{
				res[index] = i;
				index++;
			}
			tr.SetArray(res, size);
			return tr;
		}
		else
		{
			int size = (StartValue - EndValue + 1) / (IncStep*(-1));
			int mod = (StartValue - EndValue + 1) % (IncStep*(-1));
			if (mod > 0)
			{
				size++;
			}
			if (size < 1)
			{
				return tr;
			}
			double* res = this->AllocDouble(size);
			int index = 0;
			for (int i = StartValue; i >= EndValue; i += IncStep)
			{
				res[index] = i;
				index++;
			}
			tr.SetArray(res, size);
			return tr;
		}
	}
	double* _AddArrayAByX(double *a, int arrayLength, double X)
	{
		if (arrayLength <= 0)
			return NULL;
		double* res = this->AllocDouble(arrayLength);
		for (int i = 0; i < arrayLength; i++)
		{
			res[i] = a[i] + X;
		}
		return res;
	}
	TdArr _AddArrayAByX(TdArr Input, double X)
	{
		TdArr res(this->MemManager);
		if (Input.Length <= 0)
		{
			return res;
		}
		res.SetArray(_AddArrayAByX(Input.GetArray(), Input.Length, X), Input.Length);
		return res;
	}
	TcArr32 _GetSubArray(Complex32 *A, int StartIndex, int EndIndex, int Step)
	{
		TcArr32 res(this->MemManager);
		int size = (EndIndex - StartIndex + 1) / Step;
		int mod = (EndIndex - StartIndex + 1) % Step;
		if (mod > 0)
		{
			size++;
		}

		if (size <= 0)
			return res;
		Complex32* sub = this->AllocComplex32(size);
		int index = 0;
		for (int i = StartIndex; i <= EndIndex; i += Step)
		{
			sub[index] = A[i];
			index++;
		}
		res.SetArray(sub, size);
		return res;
	}
