	Complex64* intelForwardFFT(double* input, int length)
	{
		if (length == 0)
			return NULL;

	//	Complex64* comp = FillRealOfArray(input, length);
		Complex64* comp = this->AllocComplex64(length);
		/*for (int i = 0; i < length; i++)
		{
		comp[i].real = input[i];
		comp[i].imag = 0;
		}*/

		DFTI_DESCRIPTOR *fft_handle;
		DftiCreateDescriptor(&fft_handle, DFTI_DOUBLE, DFTI_REAL, 1, length);
		DftiSetValue(fft_handle, DFTI_PLACEMENT, DFTI_NOT_INPLACE);
		DftiCommitDescriptor(fft_handle);
		DftiComputeForward(fft_handle, input,comp);
		DftiFreeDescriptor(&fft_handle);

		int counter = 1;
		if (length%2 == 0)
		{
			counter = 1;
		}
		else
		{
			counter = 0;
		}
		
		int len_2 = length / 2;
		for (int i = len_2 + 1; i < length; i++)
		{
			comp[i].real = comp[len_2 - counter].real;
			comp[i].imag = comp[len_2 - counter].imag * -1;
			counter++;
		}
		//MKL_FreeBuffers();
		return comp;
	}
