	double* convByFFT(double* input1, int input1length, double* input2, int input2length)
	{
		int L = input1length + input2length - 1;
		int pown = 1;
		int e = 0;
		while (pown<L)
		{
			pown = pown * 2;
			e++;
		}
		Complex64* v1 = this->AllocComplex64(pown);

		Complex64* v2 = this->AllocComplex64(pown);
		for (int i = 0; i<input1length; i++)
		{
			v1[i].real = input1[i];
		}

		for (int i = 0; i<input2length; i++)
		{
			v2[i].real = input2[i];
		}
		intelForwardFFT_Inplace(v1, pown);
		intelForwardFFT_Inplace(v2, pown);
		//  ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==  
		/*HANDLE ffth[2];
		unsigned thrid;
		T_fftthreadInput input1;
		input1.data = v1;
		input1.dataLength = pown;

		T_fftthreadInput input2;
		input1.data = v2;
		input1.dataLength = pown;

		ffth[0] = (HANDLE)_beginthreadex(NULL, 0, &ForwardFFTThreadHandler, (void*)&input1, 0, &thrid);
		ffth[1] = (HANDLE)_beginthreadex(NULL, 0, &ForwardFFTThreadHandler, (void*)&input2, 0, &thrid);
		WaitForSingleObject(ffth[0], INFINITE);
		WaitForSingleObject(ffth[1], INFINITE);
		CloseHandle(ffth[0]);
		CloseHandle(ffth[1]);
		ffth[0] = NULL;
		ffth[1] = NULL;*/
		//  ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==    ==  
		Complex64* sum = this->AllocComplex64(pown);

		for (int i = 0; i<pown; i++)
		{
			sum[i].real = (v1[i].real*v2[i].real) - (v1[i].imag*v2[i].imag);
			sum[i].imag = (v1[i].real*v2[i].imag) + (v1[i].imag*v2[i].real);
		}
		this->FREEMEM((void**)&v1);
		this->FREEMEM((void**)&v2);
		intelBackwardFFT_Inplace(sum, pown);
		double* realiRes = this->AllocDouble(pown);

		for (int i = 0; i<pown; i++)
			realiRes[i] = sum[i].real;
		this->FREEMEM((void**)&sum);
		return realiRes;
	}
